import java.io.BufferedOutputStream;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.ObjectOutputStream;
import java.io.OutputStreamWriter;
import java.net.Socket;

public class ClientSocket {

	public static void main(String[] args) {
		BufferedWriter writer = null;
		ObjectOutputStream oos=null;
		Socket socket=null;
		try {
			socket = new Socket("127.0.0.1", 8906);
			oos=new ObjectOutputStream(new BufferedOutputStream(socket.getOutputStream()));
//			oos.writeObject(obj);
			writer = new BufferedWriter(new OutputStreamWriter(socket.getOutputStream(), "utf-8"), 4096);
			boolean stopSocket=false;
			int count=0;
			while (!stopSocket) {
				if (count>=10) {
					stopSocket=true;
					continue;
				}
				String stringa="1234567890aassaasaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa\n";
				String stringb="";
				System.out.println("Stringa length:"+stringa.length());
				System.out.println("Stringb length:"+stringb.length());
				writer.write(stringa);
				writer.write(stringb);
				writer.flush();
				count++;
			}
		} catch (Exception e) {
			e.printStackTrace();
		}finally{
			if (writer!=null) {
				try {
					writer.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
			if (socket!=null) {
				try {
					socket.close();
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
			
		}
	}
}
